import React, { Component } from 'react'
import { connect } from 'react-redux'
import { NavBar, InputItem, TextareaItem, Button } from 'antd-mobile'
import HeaderSelector from '../../components/header-selector/header-selector'

class BossInfo extends Component {
    render() {
        return (
            <div>
                <NavBar>Complete Boss Info</NavBar>
                <HeaderSelector />
                <InputItem placeholder="Please enter hiring position">Hiring Position:</InputItem>
                <InputItem placeholder="Please enter company name">Company Name:</InputItem>
                <InputItem placeholder="Please enter salary">Salary:</InputItem>
                <TextareaItem title="Position Requirement" rows={3} />
                <Button></Button>
            </div>
        )
    }
}

export default connect(
    state => (
        {}
    ),
    {}
